style.css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("stumbleupon.com") {

.colMain {

margin-right:0px !important;
margin-left:200px !important;
width: 60% !important;
}
.colRight {
float:left !important;
width: 20% !important;
}

#wrapperHeader {
background: url('data:image/gif;base64,') !important;

}

#wrapperHeader div, #wrapperContent, #wrapperFooter  {
background-color: transparent !important;
}
#wrapperNav {
background:transparent url('data:image/gif;base64,%3D') repeat-x scroll 0 0 !important;
border: none !important;
height: 50px;
}

body {
background-color: #2E0815 !important;
font-family:"Lucida Grande",Tahoma,Verdana,Sans-serif !important;
color: #E75982 !important;
}

#content {
background: #650A33 url('data:image/gif;base64,%3D') repeat-x top center !important;
margin-top: 20px !important;
border: 1px solid transparent;
-moz-border-radius: 10px;
}

a.btnYellow[ondblclick="stumble_thru"] {
display: none;
}
.headerControls h1 {
font-size: 10px !important;
}

.listStumble li.listLi, 
.listStumble .controls li,
.listUrls li, 
.listStumble .img, 
div.theme.checked a.current, 
.borderBottom, 
.borderTop, 
.borderLeft, 
.borderRight {

border-color:#E75982 !important;
}

 .listStumble .views span,
 .colRight .listUrls .views span, 
 a, 
 #dashboard a,
h1, h2, h3, h4, h5, h6
 {
color:#E75982 !important;
}

#navSecondary {
background: transparent !important;
border-top: none;
border-left: none;
}


html, body, div, span, object, iframe, address, blockquote, h1, h2, h3, h4, h5, h6, p, pre, a, abbr, acronym, b, bdo, big, cite, code, del, dfn, em, i, img, ins, kbd, q, samp, small, strong, sub, sup, tt, var, dl, dt, dd, ol, ul, li, form, fieldset, legend, label, table, caption, thead, tfoot, tbody, tr, th, td {
font-size: 11px !important;
}
.listStumble li.listLi {
border-bottom:1px dashed #E75982 !important;
}
.listStumble li.listLi:hover {
background: transparent !important;
}

.groupPostWrapper {

clear: none !important;
}
#fdbk_tab{
position:absolute !important;
top: 200px;
}
